import React from 'react';
import './card.styles.css';


export const Card = (props) => (
    <div className='card-container'>
        <img alt="korean" src={`https://lyricstranslate.com/files/styles/artist/public/3071647.jpg&size=180x180`} />
        <h1> {props.korean.name}</h1>
    </div>
)

export const Card1 = (props) => (
    <div className='card-container'>
        <img alt="korean" src={`https://resizing.flixster.com/qz5tJ7ln2HseKTW-8QVvqZoGJKU=/300x300/v2/https://flxt.tmsimg.com/assets/p21402965_i_h8_ac.jpg&size=180x180`} />
        <h1> {props.korean.name}</h1>

    </div>
)
